  \"Photocatalytic and Adsorptive System for Odor Control in Lunar Surface Systems
  Using Silica-Titania Composites Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T00:58:11.962693\",\n\t\"name\": \"photocatalytic-and-adsorptive-system-for-odor-control-in-lunar-surface-systems-using-silic\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed work herein focuses on waste
  subsystems with emphasis onnodor control associated with volatile organic compounds
  (VOCs). Thendevelopment of efficient odor removal systems for use inside lunarnmission
  architectures is one of NASA's critical needs (Topic X2.03).nBecause of the limited
  space and resources in both exploration vehiclesnand non-moving habitats, it is
  important for a treatment system to bencompact, lightweight, and robust, and have
  low energy and material inputnrequirements with the ultimate focus on reducing equivalent
  systems massn(ESM). Professors at the University of Florida have developed a novel,nrobust,
  and highly effective Silica-Titania Composite (STC) capable ofnadsorbing and oxidizing
  VOCs to harmless byproducts. The technology hasnbeen licensed by Sol-gel Solutions,
  LLC. In preparation for the designnand fabrication of a prototype for validation
  in a relevant environmentnduring a Phase II study, the evaluation and optimization
  of twonpotential configurations employing the STC is proposed. Onenconfiguration
  would employ continuous UV irradiation, and the othernwould employ intermittent
  UV. The ultimate goal is to determine whichnconfiguration results in a lower Equivalent
  Systems Mass (ESM).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
